.xinxi {
  width: 100vw;
  height: 100vh;
  background: #122f7e;
}
/* 头部标签 */
.header {
  height: 8%;
  width: 100%;
  margin-bottom: 10px;
  /* overflow: hidden; */
  background-image: url("../../assets/yingzhi/topback.png");
  background-repeat: no-repeat;
  background-size: 100%;
}
.daoy {
  position: relative;
  left: 20px;
  top: 5px;
}
.header_text {
  width: 30%;
  text-align: center;
  color: #fff;
  line-height: 50px;
  font-size: 20px;
  letter-spacing: 10px;
  float: left;
  position: absolute;
  left: 50%;
  top: 0%;
  margin-left: -15%;
}
.body {
  width: 95vw;
  height: 85vh;
  background: rgba(240, 240, 240, 0.15);
  margin-left: 2.5vw;
  padding-top: 20px;
}
.body_herder {
  border-radius: 50px;
  height: 30px;
  width: 250px;
  border: 1px solid #ffffff;
  line-height: 30px;
  color: #fff;
  background: #1e3b88;
  margin-left: 30px;
  margin-bottom: 20px;
  overflow: hidden;
}
.body_herder div {
  display: inline-block;
  width: 49%;
  text-align: center;
  cursor: pointer;
}
.tab {
  width: 95%;
  margin-left: 2.5%;
  text-align: center;
  border: 1px solid #15c8fb;
}
.tab td {
  border: 1px solid #15c8fb;
  color: #fff;
  font-size: 15px;
  height: 35px;
}
.tab th {
  border: 1px solid #15c8fb;
  color: #6ed9fb;
  font-size: 18px;
  height: 50px;
}
/* 分页开始 */
.page-bar {
  position: absolute;
  bottom: 30px;
  left: 35%;
  user-select: none;
}
.page-bar li {
  float: left;
  list-style: none;
}
.page-bar li:first-child > a {
  margin-left: 0px;
}
.page-bar a {
  border: 0;
  text-decoration: none;
  position: relative;
  text-align: center;
  margin-left: -1px;
  cursor: pointer;
  display: inline-block;
  width: 1.6vw;
  height: 1.6vw;
  line-height: 1.6vw;
  border-radius: 100%;
  background: #2373a1;
  margin: 0.5vw;
  color: #ffffff;
  font-size: 0.7vw;
}
.page-bar a .banclick {
  cursor: not-allowed;
}
.page-bar a i {
  font-style: normal;
  color: #d44950;
  margin: 0px 4px;
  font-size: 0.7vw;
}
.active a {
  cursor: default;
  background: #70dcfb;
}
.page-bar .shuang a {
  color: #fff;
}
/* 分页结束 */
